import React from 'react';
import { ImageBackground, Image, View, Text, Button, StyleSheet } from 'react-native';
import { useNavigation } from '@react-navigation/native';

//Styling
import { StyledView } from '../styles/wrapper'
import { BckImg } from '../styles/wrapper'



const WelcomeScreen = () => {
  const navigation = useNavigation();

  return (
    <StyledView>
      <BckImg source={require('../assets/welcomeTemp.jpg')} resizeMode="cover">
        
      </BckImg>
      <View
          
          />
          <View>
            <Button
              
              title="Login"
              onPress={() => navigation.navigate('Login')}
            />
            <Button
              
              title="Register"
              onPress={() => navigation.navigate('Register')}
            />
          </View>
      
    </StyledView>
  );
};

export default WelcomeScreen;
